('2323','18','7868','Villa Jake Malcom',Null,'Neu sanierte Einfamilien Villa in Hafennähe von Porto d`Andratx','32806','Diese neu sanierte Villa steht auf einem  ca 2.000m² grossen Grundstück. Von hier aus sind es nur wenige Gehminuten bis zum Jachthafen von Porto d´Andratx und den beliebten Restaurants. Die Villa verfügt über 2 Wohnetagen mit 5 Schlafzimmern und 5 Badezimmern en suite. Zur hochwertigen Ausstattung gehören u.a. PVC Doppelglasfenster, Alu Fensterläden, Klimaanlage w/k, Öl Zentralheizung und eine schicke moderne Einbauküche. Der großzügig angelegte Poolbereich bietet offene und überdachte Terrassen. 2 Autos finden Platz auf einem überdachten Carport.   \r\nBilder und weitere Infos erhalten Sie bei Anfrage und Angabe Ihres Namens und einer Tel Nummer\r\n','32807','3995000','106','2015-04-27 10:16:41','106','2015-04-27 10:17:37',Null,'2377','166','518',1,'1','0',Null,Null,Null,'32808',Null,'0','0','0',Null,'2015-04-27 10:21:27',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32809',Null,'32810',Null,'32811',Null,'32812','647769214','32813','0',0,'4');
